import React from "react";
import "./footer.css";
const Footer = () => {
  return (
    <div>
      <div className="footerContainer">
        <ul>
          <li>Free Shiping</li>
          <li>Support 24/7</li>
          <li>Money Return</li>
          <li>100% Payment Secure</li>
        </ul>
      </div>
    </div>
  );
};

export default Footer;
